// src/components/AdminHeader.js

import React from 'react';
import { Link } from 'react-router-dom';
import './AdminHeader.css'; // Assuming you'll add custom styling

function AdminHeader() {
  return (
    <nav className="admin-navbar">
      <ul className="admin-nav-list">
        <li className="admin-nav-item">
          <Link to="/admin/home" className="admin-nav-link">Home</Link>
        </li>
        <li className="admin-nav-item">
          <Link to="/admin/orders" className="admin-nav-link">Orders</Link>
        </li>
        <li className="admin-nav-item">
          <Link to="/admin/brands" className="admin-nav-link">Brands</Link>
        </li>
        <li className="admin-nav-item">
          <Link to="/admin/users" className="admin-nav-link">Users</Link>
        </li>
      </ul>
    </nav>
  );
}

export default AdminHeader;
